import React from 'react'
import './Menu.component.scss'
import { Link, useHistory } from 'react-router-dom'
import { motion } from "framer-motion"

const wrapperVariants = {
    visible:{
        transition: {
            when: "beforeChildren",
            staggerChildren: 0.3
        }
    }
}

export default function Menu() {
    return (
        <motion.div className="menu">
            <Link to="/" exact>
                <motion.h3>Home</motion.h3>
            </Link>
            <Link to="/produse" exact>
                <motion.h3>Produse</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3>Livrare</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3>Retur</motion.h3>
            </Link>
            <Link to="/info" exact>
                <motion.h3>Plata</motion.h3>
            </Link>
        </motion.div>
    )
}
